import React  from "react";
import style from './reciepe.module.css'
const Recipe = ({title, calories,image}) =>{
    return(
        <div>
            <h1 className="style.reciepe">{title}</h1>
            <p>{calories}</p>
            <img src={image} alt="/" />
        </div>
    )
}
export default Recipe;
